import React from "react";
import { Component } from "react";
import { withRouter } from "react-router-dom";
import styles from "./userdetails.module.css";
import stud from '../../img/stud.jpg';
import Sidebar from "../sidebar/sidebar";

class userdetails extends Component {
    render() {
        return (
            <div className={styles.main_content}>
                <Sidebar/>
                <div className={styles.border_box}>
                <div className={styles.profilephoto}>
                <img src={stud} />
                </div>
                <hr className={styles.after_img} />
                <div className="data">
                <div className="degree">B.Tech Computer Engg.</div><br /><br />
                <div className="display-data">FULL NAME: </div>abc &nbsp; &nbsp; <a href='#.html'><img src='css\img\edit.png' width='22px' height="22px" /></a><hr class ="after-data" />
                <div className="display-data">Date of birth: </div> 01/11/2001 <hr class ="after-data" />
                <div className="display-data">gender: </div> male <hr class ="after-data" />
                <div className="display-data">address: </div> xyz society, abc park, pqr &nbsp; &nbsp; <a href='#.html'><img src='css\img\edit.png' width='22px' height="22px" /></a> <hr class ="after-data" />
                <div className="display-data">contact: </div> 9876543210 &nbsp; &nbsp; <a href='#.html'><img src='css\img\edit.png' width='22px' height="22px" /></a> <hr class ="after-data" />
                <div className="display-data">email-address: </div> abc @pqr.com &nbsp; &nbsp; <a href='#.html'><img src='css\img\edit.png' width='22px' height="22px" /></a> <hr class ="after-data" />
                <div className="display-data">Year of admission: </div> 2017 <hr class ="after-data" />
                <div className="display-data">Merit rank: </div> 782 <hr class ="after-data" />
                <div className="display-data">Mode of admission: </div> GIA <hr class ="after-data" />
                </div>
                </div>
            </div>

        )

    }
}

export default withRouter(userdetails)
